import React, { useState } from "react";
import "./styles.css";

function App() {
  const [messages, setMessages] = useState([]);
  const [input, setInput] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  const handleSendMessage = async () => {
    if (!input.trim()) return;

    // Add user's message to the chat
    const userMessage = { sender: "user", text: input };
    setMessages((prev) => [...prev, userMessage]);
    setInput("");

    // Fetch ChatGPT response
    setIsLoading(true);
    try {
      const response = await fetch("https://api.openai.com/v1/chat/completions", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Authorization": `Bearer YOUR_API_KEY`, // Replace with your actual OpenAI API key
        },
        body: JSON.stringify({
          model: "gpt-4", // You can also use "gpt-3.5-turbo"
          messages: [{ role: "user", content: input }],
          max_tokens: 100,
        }),
      });

      const data = await response.json();
      const botMessage = { sender: "bot", text: data.choices[0].message.content };

      setMessages((prev) => [...prev, botMessage]);
    } catch (error) {
      console.error("Error fetching ChatGPT response:", error);
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div className="app-container">
      {/* Existing app content */}
      <header className="hero">
        <div className="hero-content">
          <h1>Calvin's Dog Walking & Training</h1>
          <p>Genuine care for your furry friends in Monterey County, California.</p>
          <a href="#contact" className="cta-button">Contact Me</a>
        </div>
      </header>

      <section className="about" id="about">
        <h2>About Me</h2>
        <p>
          I’ve been working with dogs my whole life, both big and small. From leash
          to off-leash training, I specialize in making sure your dog is well-behaved
          and happy. Whether it’s walking, training, or caring for other animals, I
          bring genuine love and care to every pet.
        </p>
      </section>

      <section className="services" id="services">
        <h2>Services</h2>
        <div className="services-grid">
          <div className="service">
            <h3>Dog Walking</h3>
            <p>One-hour walk: $50</p>
            <p>One-hour walk + 30 minutes training: $100</p>
          </div>
          <div className="service">
            <h3>Training</h3>
            <p>30-minute session: $60</p>
            <p>One-hour session: $100</p>
          </div>
        </div>
      </section>

      <section className="contact" id="contact">
        <h2>Contact Me</h2>
        <form>
          <input type="text" placeholder="Your Name" />
          <input type="email" placeholder="Your Email" />
          <textarea placeholder="Your Message"></textarea>
          <button type="submit">Submit</button>
        </form>
      </section>

      <footer>
        <p>&copy; 2025 Calvin's Dog Walking & Training Services. All rights reserved.</p>
      </footer>

      {/* Chatbot UI */}
      <div className="chatbot">
        <div className="chat-header">
          <h3>Calvin's Assistant</h3>
        </div>
        <div className="chat-messages">
          {messages.map((msg, index) => (
            <div
              key={index}
              className={`chat-message ${msg.sender === "user" ? "user" : "bot"}`}
            >
              {msg.text}
            </div>
          ))}
          {isLoading && <div className="chat-message bot">Typing...</div>}
        </div>
        <div className="chat-input">
          <input
            type="text"
            value={input}
            onChange={(e) => setInput(e.target.value)}
            placeholder="Ask me anything..."
          />
          <button onClick={handleSendMessage} disabled={isLoading}>
            Send
          </button>
        </div>
      </div>
    </div>
  );
}

export default App;
